import React from 'react';
import './Contact.css';
import location from "../images/location.png";

function Contact() {
    return(
        <div className='container'>
            <div className='contactinfo'>
                <div>
                    <h2>Contact Info</h2>
                    <ul className='info'>
                        <li>
                            <span><img src={location}></img></span>
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    );
}

export default Contact;
